import './IMA.css';
import REturnTitle from './Title';

// view component image
export default function REturnBgIMA() {
 return (
  <div className='flx-img-bg'>
   <div className='clr-bg-black'></div>

   <div className='img-bg-home'>
    <img src={'/img/imagemoney.jpeg'} alt={'home view page'} />
   </div>

   <REturnTite />
  </div>
 )
};
